import React from "react";

import { About, Footer, Header, Skills, Testimonials, Work } from "./container";
import { Nav } from "./components";

const App = () => {
  return (
    <div className="app">
      <Nav />
      <Header />
      <About />
      <Work />
      <Skills />
      <Testimonials />
      <Footer />
    </div>
  );
};

export default App;
